import React from 'react'

// import link
import { Link } from 'react-router-dom'

// import image
import intLOGO from '../../assets/images/interactlogo.SVG'

const socialLinks = [
{
  path: "#",
  icon: <i class="ri-facebook-line" className='w-4 h-5' />,
},
];

const quickLinks01 = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "/checkin",
    display: "Mental Check In",
  },
  {
    path: "/contact",
    display: "Contact",
  },
];

const Footer = () => {

  const year = new Data().getFullYear()

  return (
    <>
    <footer className='pb-16 pt-10'>
      <div className="container">
          <div className="flex justify-between flex-col md:flex-row flex-wrap gap-[30px]">

          </div>
      </div>     
    </footer>
    </>
  )
}

export default Footer
